INSERT INTO siconv.acffo_resposta (pergunta_fk,resposta,laudo_fk,nr_versao_hibernate,versao_nr,versao_id,versao_nm_evento) VALUES 
(46,'Não',68,1,0,'6591','EMC')
,(52,'A maior parte dos serviços apresentados não foram referenciados pelo SINAPI mais recente referente ao estado do Pará. Solicitamos que utilizem a tabela do SINAPI mais recente  conforme determina a Portaria interministerial 424/2016.  Não informam se a planilha é com ou sem desoneração. Caso seja desonerada o BDI está adequado  mas se não for, o BDI deve ser de até 27%.   Não há projeto de SPDA na planilha, caso não seja necessário justificar. A planilha será analisada detalhadamente quando forem feitas as adequações solicitadas. As seguintes observações devem ser respeitadas:
O FNDE não financia movimentação de terra.
O FNDE não financia, serviços de geologia ou outros serviços desta natureza.
Não utilizar as unidades (verba), (ponto) ou outra unidade que não caracterize com objetividade 
O FNDE não financia ações de pavimentação de vias, calçadas e meio fios externos a delimitação do terreno. Não utilizar serviços como administração de obra, transporte de funcionários, EPIs, alimentação, taxas, emolumentos, aluguel de equipamentos, mobilização e desmobilização, etc. Estes custos devem estar incluídos nos preços de cada serviço (insumos).
Não é necessária a separação dos custos de mão de obra e materiais na composição dos serviços.
Solicitamos que sejam acrescentados os códigos da Tabela SINAPI na descrição dos serviços da planilha orçamentária. Composições não contempladas no SINAPI poderão ser aceitas em conformidade com a LDO 2013 (Lei 12.708/2012), § 3º, art 102.',68,3,0,'6504','EMC')
,(62,'A maior parte dos serviços apresentados não foi referenciada pelo SINAPI mais recente referente ao estado do Pará. Solicitamos que utilizem a tabela do SINAPI mais recente referente ao estado do Pará conforme determina a Portaria interministerial 424/2016.',68,2,0,'6507','EMC')
,(87,'A Planilha apresentada informa que o valor da obra é de R$ 387.755,10, porém o cronograma apresentado está dito que o valor da obra é R$ 387.742,63. O valor da obra deve ser o mesmo em todos os documentos encaminhados. Solicitamos compatibilizar as informações para analisarmos corretamente seu pleito.',68,2,0,'6545','EMC')
,(93,'Quando forem licitar a obra e apresentar o Projeto Executivo, a entidade deve estar com o seu projeto aprovado nos órgãos que o estado do Pará exigir a aprovação antes do início da execução.',68,2,0,'6562','EMC')
,(102,'Viável, com pendência(s)',68,1,0,'6575','EMC')
,(82,'Solicitamos que apresentem a composição do BDI utilizado. A proposta apresentada não prevê a aquisição de equipamentos e portanto a pergunta 12.2 não se aplica.',68,2,0,'6569','EMC')
,(47,'No projeto apresentado só existe um banheiro. De acordo com a NBR 9050, um cadeirante por exemplo, não pode percorrer mais de 50m para ter acesso a um banheiro. Solicitamos que atendam  o que diz a  NBR 9050 pois o projeto deve ter acessibilidade para todos.  Ver link a seguir sobre a IN02/2017 do Ministério do Planejamento.  
http://portal.convenios.gov.br/legislacao/instrucoes-normativas/instrucao-normativa-n-2-de-9-de-outubro-de-2017',68,2,0,'6592','EMC')
,(14,'Como não foi encaminhada a certidão de registro do imóvel não foi possível compatibilizar as informações contidas na Planta de localização para sabermos se o terreno onde será construído o auditório é o mesmo. Não foi encaminhada Declaração da Universidade se responsabilizando pelos serviços de infraestrutura básica para execução da intervenção(ver modelo anexado nesta análise). A universidade deve encaminhar a referida declaração. É possível ver pelas plantas encaminhadas que a área onde será construído o auditório é plana.',68,3,0,'6514','EMC')
,(103,'A proposta está adequada ao valor disponibilizado pela emenda porém vários documentos de engenharia encaminhados ainda  apresentam pendencias que devem ser corrigidas no prazo de 30 dias e reencaminhada para análise.',68,2,0,'6574','EMC')
;
