,(30,'Vários serviços apresentados nas plantas técnicas encaminhadas não foram encontrados na planilha, assim como alguns serviços que aparecem nas plantas não constam da planilha. As plantas encaminhadas estão coloridas e as letras estão em amarelo, inviabilizando a leitura adequada do que está descrito lá. Solicitamos que encaminhem tudo em preto e branco para melhor visualização. Solicitamos enviar a planta de locação com os dados necessários para analisarmos. Deve ser enviada a planta baixa da área do campus onde sera construído o auditório  com suas amarrações às divisas do lote proposto, aos outros prédios, a indicação das cotas de nível da mesma em relação a todos os acessos,  ao passeio e a rua. Além do norte magnético. Identificar o nome das vias próximas   Todos os serviços necessários a execução do objeto devem estar compatíveis na planilha, nas plantas e no Memorial(não encaminhado). Encaminhar Memorial descritivo da obra.  Encaminhar planta com  detalhes do projeto.  Favor compatibilizar as informações existentes nas plantas com os serviços descritos na planilha para analisarmos adequadamente seu pleito.',68,5,0,'6521','EMC')
