,(4,'Sim',218,0,0,'22272','EMC')
,(19,'A manutenção e conservação da parte da rede de drenagem existente e sinalização existente nas vias é de responsabilidade da Prefeitura Municipal por recursos próprios. Para a 1ª liberação de recursos: a rede de drenagem existente deverá receber a manutenção da Prefeitura e deverá estar limpa e desobstruída e com plena funcionalidade. A Prefeitura deverá apresentar declaração com esta afirmação e relacionando os serviços executados. Para a última liberação de recursos: a sinalização vertical existente deverá permanecer em obra e deverá estar em estado adequado de conservação. O nível das grades das bocas de lobo novas e existentes deverá estar adequado com o novo pavimento a ser executado para que não haja degraus na pista devido à espessura da nova camada.',214,0,0,NULL,NULL)
