,(101,'1) A Prefeitura deve apresentar comprovante de pagamento das RRT’s; 2) Por equívoco da profissional, as RRT’s apresentadas foram geradas com a informação de que não se exige observância das regras de acessibilidade, o que é contrário às regras do Programa. A profissional deve apresentar as  RRT’s corrigidas ou complementares com o atendimento dos requisitos de acessibilidade para a contratação da operação (a Prefeitura já apresentou declaração de conformidade de acessibilidade, conforme a IN002/2018 e também apresentou a Lista de verificação de acessibilidade); 3) A declaração de capacidade técnica é um documento exigido para a autorização de início de obras e a Prefeitura costuma apresentar a mesma juntamente com os documentos do processo licitatório;',214,0,0,NULL,NULL)
