INSERT INTO siconv.acffo_resposta (pergunta_fk,resposta,laudo_fk,nr_versao_hibernate,versao_nr,versao_id,versao_nm_evento) VALUES 
(47,'1) A Prefeitura deve apresentar comprovante de pagamento das RRT’s; 2) Por equívoco da profissional, as RRT’s apresentadas foram geradas com a informação de que não se exige observância das regras de acessibilidade, o que é contrário às regras do Programa. A profissional deve apresentar as  RRT’s corrigidas ou complementares com o atendimento dos requisitos de acessibilidade para a contratação da operação (a Prefeitura já apresentou declaração de conformidade de acessibilidade, conforme a IN002/2018 e também apresentou a Lista de verificação de acessibilidade); 3) O contrato é nível I, e de acordo com o Manual Normativo Caixa AE099 versão 17: "3.2.10.4.1.1 Na análise de engenharia o arquiteto/engenheiro CAIXA não verifica o atendimento destes requisitos legais."; "3.2.10.4.2 Para CR assinados a partir de 02/01/2018, o Proponente/Tomador também deverá atender à Instrução Normativa MPDG nº 2/2017."; "3.2.10.4.2.1 Nestes casos, o Proponente/Tomador deverá apresentar, para análise de engenharia de projeto pelo arquiteto/engenheiro da GIGOV/REGOV, Declaração de Conformidade em Acessibilidade e Lista de Verificação de Acessibilidade, ambas assinadas pelo responsável técnico pela elaboração do projeto." 3.2.10.4.2.2 Para CR Nível I e II, o arquiteto/engenheiro da GIGOV/REGOV apenas verificará se, dentre os documentos constantes do projeto de engenharia, constam a Declaração de Conformidade em Acessibilidade e a Lista de Verificação de Acessibilidade."',214,0,0,NULL,NULL)
