,(66,'Houve divergência de R$ 0,01 entre o valor total da ABC e o valor do orçamento inserido no SICONV, devido a diferença no método de cálculo dos valores, contudo, a diferença não altera qualquer aspecto da análise.',270,1,0,NULL,NULL)
,(103,'Considerando a divergência entre o LAE fornecido pela matriz da CAIXA (MO41021) e o do SICONV, foi anexada cópia da via física do documento.
Há divergência de R$ 0,01 entre o valor total da curva ABC e o valor do orçamento no SICONV, devido à divergência do método de arredondamento, contudo não há implicações na análise de custos, uma vez que não há alteração dos itens significativos e nas quantidades.
Considerando a alteração das frentes de obra, apresentar orçamento atualizado em meio físico, conforme inserido no sistema SICONV. Salientamos que os documentos relacionados ao orçamento (PLQ, etc) também deverão ser reapresentados para AIO.
Já foi apresentada ART de fiscalização.',270,1,0,NULL,NULL)
