,(52,'A maior parte dos serviços apresentados não foram referenciados pelo SINAPI mais recente referente ao estado do Pará. Solicitamos que utilizem a tabela do SINAPI mais recente  conforme determina a Portaria interministerial 424/2016.  Não informam se a planilha é com ou sem desoneração. Caso seja desonerada o BDI está adequado  mas se não for, o BDI deve ser de até 27%.   Não há projeto de SPDA na planilha, caso não seja necessário justificar. A planilha será analisada detalhadamente quando forem feitas as adequações solicitadas. As seguintes observações devem ser respeitadas:
O FNDE não financia movimentação de terra.
O FNDE não financia, serviços de geologia ou outros serviços desta natureza.
Não utilizar as unidades (verba), (ponto) ou outra unidade que não caracterize com objetividade 
O FNDE não financia ações de pavimentação de vias, calçadas e meio fios externos a delimitação do terreno. Não utilizar serviços como administração de obra, transporte de funcionários, EPIs, alimentação, taxas, emolumentos, aluguel de equipamentos, mobilização e desmobilização, etc. Estes custos devem estar incluídos nos preços de cada serviço (insumos).
Não é necessária a separação dos custos de mão de obra e materiais na composição dos serviços.
Solicitamos que sejam acrescentados os códigos da Tabela SINAPI na descrição dos serviços da planilha orçamentária. Composições não contempladas no SINAPI poderão ser aceitas em conformidade com a LDO 2013 (Lei 12.708/2012), § 3º, art 102.',346,4,1,'6504','EMC')
;
INSERT INTO siconv.acffo_resposta (pergunta_fk,resposta,laudo_fk,nr_versao_hibernate,versao_nr,versao_id,versao_nm_evento) VALUES 
(30,'Vários serviços apresentados nas plantas técnicas encaminhadas não foram encontrados na planilha, assim como alguns serviços que aparecem nas plantas não constam da planilha. As plantas encaminhadas estão coloridas e as letras estão em amarelo, inviabilizando a leitura adequada do que está descrito lá. Solicitamos que encaminhem tudo em preto e branco para melhor visualização. Solicitamos enviar a planta de locação com os dados necessários para analisarmos. Deve ser enviada a planta baixa da área do campus onde sera construído o auditório  com suas amarrações às divisas do lote proposto, aos outros prédios, a indicação das cotas de nível da mesma em relação a todos os acessos,  ao passeio e a rua. Além do norte magnético. Identificar o nome das vias próximas   Todos os serviços necessários a execução do objeto devem estar compatíveis na planilha, nas plantas e no Memorial(não encaminhado). Encaminhar Memorial descritivo da obra.  Encaminhar planta com  detalhes do projeto.  Favor compatibilizar as informações existentes nas plantas com os serviços descritos na planilha para analisarmos adequadamente seu pleito.',346,6,1,'6521','EMC')
