,(87,NULL,377,0,0,NULL,NULL)
,(47,'Foi apresenta a declaração e Lista de Acessibilidade no modelo da IN002/2018. Porém, foi apresentada uma declaração de que por ser uma estrada turística vicinal de ligação de pontos turísticos importantes, mas que não possui previsão de calçadas, nem há travessias com outras estradas e com pouco fluxo de pedestres locais, não se aplicam itens de acessibilidade. Conforme memorial fotográfico em anexo, trata-se de uma estrada de chão consolidada vicinal para passagem de turistas onde, conforme o croqui de pontos turísticos em anexo, há a ligação do município de Garibaldi a um dos maiores polos turísticos da Serra gaúcha: o Vale dos Vinhedos no município de Bento Gonçalves. O projetista marcou na Lista de Verificação de Acessibilidade que os itens não se aplicam. // Como o contrato é nível 1, segundo o Manual normativo AE099017: "3.2.10.4.2.2 Para CR Nível I e II, o arquiteto/engenheiro da GIGOV/REGOV apenas verificará se, dentre os documentos constantes do projeto de engenharia, constam a Declaração de Conformidade em Acessibilidade e a Lista de Verificação de Acessibilidade.". Os documentos foram apresentados pela Prefeitura e estão assinados.',376,0,0,NULL,NULL)
,(76,'24.23',376,0,0,NULL,NULL)
,(81,'Não se aplica',376,0,0,NULL,NULL)
,(82,'A composição do BDI atende aos limites do Acórdão 2622/2013/TCU e o sistema declarado pela Prefeitura como o mais adequado foi o Sem Desoneração. A Prefeitura baseou o modelo da composição na planilha PO constante no site oficial da Caixa.',376,0,0,NULL,NULL)
