INSERT INTO siconv.acffo_resposta (pergunta_fk,resposta,laudo_fk,nr_versao_hibernate,versao_nr,versao_id,versao_nm_evento) VALUES 
(19,'O trecho a pavimentar é a última etapa que resta para completar a ligação de Garibaldi ao Vale dos Vinhedos através da Estrada São Gabriel. Restam apenas os 772m previstos neste contrato. Devido ao recurso OGU ser insuficiente para a conclusão do trecho e, como a Prefeitura possui muito interesse em completar logo a pavimentação, a planilha orçamentária global foi separada em 2 lotes para serem licitados no mesmo certame: um via Caixa e outro exclusivo de recursos próprios. A planilha global dos dois lotes está em anexo com valor previsto de R$671.400,87, sendo que a planilha do lote via Caixa é de R$369.508,70. No lote de recursos próprios da Prefeitura estão previstos: serviços preliminares, mobilização e desmobilização, serviços topográficos, terraplenagem, regularização e compactação de sub-leito, camada de brita anti-intrusiva, drenagem, ensaios tecnológicos e sinalização. No lote via Caixa estão previstas as camadas de base de brita graduada, imprimação, pintura de ligação e CBUQ. Para a 1 liberação de recursos da presente emenda, os serviços preliminares, levantamento topográfico, mobilização de máquinas e equipamentos, drenagem (ao menos tubulações completas e reaterradas), terraplenagem, regularização e compactação de sub-leito e camada de brita anti-intrusiva deverão estar concluídos por recursos próprios da Prefeitura. Para a última liberação de recursos, todos os serviços de ambos os lotes deverão estar concluídos;',376,0,0,NULL,NULL)
,(17,'Não se aplica',376,0,0,NULL,NULL)
,(18,'Não',376,0,0,NULL,NULL)
,(89,'Não se aplica',376,0,0,NULL,NULL)
