,(93,NULL,376,0,0,NULL,NULL)
,(83,'6 meses',376,0,0,NULL,NULL)
,(84,'Sim',376,0,0,NULL,NULL)
,(87,'O cronograma global de obras é de 6 meses para os lotes de repasse e de recursos próprios da Prefeitura. O cronograma dos serviços do lote de repasse via Caixa é de 3 meses e obedece às regras da Portaria 424/2016 e IN002/2018.',376,0,0,NULL,NULL)
,(86,'Sim',376,0,0,NULL,NULL)
