(80,'Sim',392,0,0,NULL,NULL)
,(77,'Sim',392,0,0,NULL,NULL)
,(103,'De antemão, sugerimos atenção especial:
1) Durante a execução dos serviços da rua Alípio F. Reis, bairro Alvoradinha, em função da travessia de águas sob o greide da via. Lembramos que não foi previsto neste CR a melhoria da solução hoje implantada de manilhas com movimentação de terra a fim de diminuir declividade da pista e, consequentemente, diminuir a possibilidade de imergi-la em épocas chuvosas.
Registramos ainda que a segurança do pedestre que circular neste trecho da calçada deverá prevalecer sobre demais intervenientes que possam surgir. 
2) Na execução do dissipador de energia hidráulica para o lançamento final de águas pluviais no Rio Corrente.
A restituição das águas no corpo hídrico deverá causar o menor impacto possível ao meio ambiente, de forma que a erosão e o assoreamento do rio sejam evitados.',392,0,0,NULL,NULL)
