(99,'Sim',392,0,0,NULL,NULL)
,(98,'Sim',392,0,0,NULL,NULL)
,(19,'1) Há integração das galerias de águas pluviais existentes com a expansão da rede proposta no projeto em ora em tela. O projeto em questão prevê o lançamento da vazão coletada no PVEX03 localizado na esquina entre as avenidas Bernardo Sayão e Dona Gercina de Melo, bairro Novo Ipiranga. A responsável técnica pelo projeto declara que a galeria de água pluvial já existente suporta o volume de água que será captado com este CR.
2) A funcionalidade plena da proposta depende da execução das calçadas e sinalização da rua 11, bairro Nova Vila. Conforme o programa a que este CR esta enquadrado, "em todos os contratos de pavimentação nova, deverá estar prevista a execução de calçadas para circulação de pedestres. As calçadas deverão apresentar soluções que garantam a acessibilidade universal para os usuários do sistema". Portanto, para a conclusão deste CR faz-se necessário que o Tomador cumpra conforme a Declaração da Prefeita na qual afima que "arcará com os custos da execução de calçadas e sinalização da rua 11, bairro Nova Vila" e que "se compromete a entregar os serviços antes da finalização" deste CR.',392,0,0,NULL,NULL)
