,(30,'Projetos de Junho de 2018.
Algumas perguntas não constam no LAE modelo padrão de engenharia CAIXA, motivo pelo qual foram respondidos como "não se aplica" (ausência de critérios normativos para avaliação). 

 A fim de enquadrar o projeto às diretrizes do programa, a respeito da rua 11 do bairro Nova Vila em que foi previsto em projeto apenas a execução do seu pavimento, o Tomador declara que "arcará com os custos da execução de calçadas e sinalização da rua 11, bairro Nova Vila" e que "se compromete a entregar os serviços antes da finalização" deste CR.',392,1,0,NULL,NULL)
,(97,'15.3 Item não avaliado no LAE 93/2018, por ausência de requisito no modelo padrão. SICONV não emitiu o Plano de Sustentabilidade.
