,(101,NULL,511,2,2,'52466',NULL)
,(103,'Os responsáveis técnicos pela execução dos serviços demandados são sempre os profissionais executores das atividades e formalmente vinculados às empresas credenciadas, conforme Lei nº. 5.194, de 24.12.1966, complementada pela Resolução nº. 425, de 18.12.98, do CONFEA e demais atos que regulamentam o exercício profissional do engenheiro, ou de acordo com a Lei n°. 12.378 de 31.12.2010, que regulamenta o exercício profissional de arquiteto. O monitoramento realizado por empregado do quadro próprio da CAIXA não implica em corresponsabilidade técnica pela atividade executada por empresa credenciada. A responsabilidade do monitor da atividade executada por empresa credenciada (engenheiro e/ou arquiteto do quadro de empregados da CAIXA) é limitada à verificação do preenchimento completo da peça técnica resultado da atividade demandada, bem como da coerência das informações ali registradas.',509,1,0,NULL,NULL)
,(3,'AE099',509,1,0,NULL,NULL)
,(14,'Foi apresentada Declaração do prefeito municipal se comprometendo com a execução de fossa-sumidouro nas unidades habitacionais não atendidas pelo sistema de esgotamento sanitário na área de intervenção vinculada ao contrato de repasse.
Foi apresentada Declaração do prefeito municipal afirmando que a área beneficiada possui  infraestrutura urbana básica (rede de água, esgoto, energia elétrica e coleta de resíduos sólidos).
Foi apresentada Declaração de Dispensa de Licença Ambiental da Secretaria Municipal de Meio Ambiente e Desenvolvimento Rural de Buritirama, emitida pelo Secretário de Agricultura Meio Ambiente e Desenvolvimento Rural. Sr. Uilton Ramos de Oliveira e pelo Diretor de Proteção ao Meio Ambiente, Sr. Nelton Ferreira da Silva.',509,1,0,NULL,NULL)
,(9,'Foi apresentada declaração do prefeito municipal, devidamente identificado, afirmando que a área de intervenção é de domínio público e passível de recebimento de investimentos públicos.',509,1,0,NULL,NULL)
