,(45,'Sim',514,1,0,NULL,NULL)
,(46,'Não se aplica',514,1,0,NULL,NULL)
,(47,'Em relação ao item 8.4, conforme estabelecido no item 3.2.10.4.2.2 do MN AE099 - ENGENHARIA - ANÁLISE E ACOMPANHAMENTO – OPERAÇÕES DE REPASSE - versão 017 (vigente na data de análise)  para contrato de repasse enquadrado no nível I da Portaria nº 424/16, o arquiteto/engenheiro da GIGOV apenas verificará se, dentre os documentos constantes do projeto de engenharia, constam a Declaração de Conformidade em Acessibilidade e a Lista de Verificação de Acessibilidade.',514,1,0,NULL,NULL)
,(40,'Sim',514,1,0,NULL,NULL)
,(41,'Sim',514,1,0,NULL,NULL)
,(39,'Sim',514,1,0,NULL,NULL)
,(30,'Em relação aos subitens 5.5 e 5.6, cumpre esclarecer que a análise de engenharia realizada pelo engenheiro da GIGOV não se confunde com a verificação da suficiência, da qualidade e da atualidade do projeto utilizado para instrução do processo licitatório, e não visa assegurar o cumprimento do que determina o inciso IX do Art. 6º da Lei n° 8.666/1993, que é responsabilidade exclusiva do Tomador/Proponente.
Destaca-se ainda, que a análise de engenharia não é atividade de auditoria e/ou de controle nem tem por objetivo a revisão de projetos, a verificação de estudos de concepção e/ou de alternativas, a conferência de dimensionamentos e respectivas memórias de cálculo e o cumprimento das Normas Técnicas aplicáveis, atividades essas que são de exclusiva responsabilidade do profissional responsável técnico pelo projeto indicado na ART/RRT correspondente.',514,2,0,NULL,NULL)
,(14,'Em vistoria realizada nos locais propostos para a intervenção não foram observados indícios de riscos ambientais e restrições físicas à intervenção proposta.',514,1,0,NULL,NULL)
,(34,NULL,517,0,0,NULL,NULL)
