,(18,'Sim',496,1,1,'50938',NULL)
,(9,'Há um Formulário Unificado de Declarações assinado pelo Sr. Prefeito na aba Requisitos para Celebração neste Siconv, no qual o Prefeito declara que o objeto será executado em imóvel do próprio ENTE e que está ciente da necessidade de anexar a comprovação.',517,4,0,NULL,NULL)
,(14,'Sobre riscos ambientais, a resposta foi positiva ao questionamento de não haver indícios de riscos ambientais. Entretanto, riscos ambientais existem em empreendimentos desse porte e desse potencial poluidor. Para identificá-los o órgão licenciador (FEAM) tem prerrogativa ou detém a competência, e é o responsável pela avaliação desses riscos e poderá propor as medidas mitigadoras que se fizerem necessárias no momento em que tais riscos se apresentem. Especificamente, sobre a construção da lagoa de estabilização é importante informar que a impermeabilização foi proposta com camada de argila, que reduz os riscos contaminação do solo e/ou água subterrânea. O Responsável Técnico pelo projeto apresentou a ART perante o CREA, anexa à este LAE.',517,4,0,NULL,NULL)
,(103,'“Os responsáveis técnicos pela execução dos serviços demandados são sempre os profissionais executores das atividades e formalmente vinculados às empresas credenciadas, conforme Lei nº. 5.194, de 24.12.1966, complementada pela Resolução nº. 425, de 18.12.98, do CONFEA e demais atos que regulamentam o exercício profissional do engenheiro, ou de acordo com a Lei n°. 12.378 de 31.12.2010, que regulamenta o exercício profissional de arquiteto. O monitoramento realizado por empregado do quadro próprio da CAIXA não implica em corresponsabilidade técnica pela atividade executada por empresa credenciada. A responsabilidade do monitor da atividade executada por empresa credenciada (engenheiro e/ou arquiteto do quadro de empregados da CAIXA) é limitada à verificação do preenchimento completo da peça técnica resultado da atividade demandada, bem como da coerência das informações ali registradas.”',543,1,0,NULL,NULL)
,(102,'Viável',543,1,0,NULL,NULL)
