,(14,'Foi apresentada declaração do gestor da COELBA afirmando que é viável o fornecimento regular de energia elétrica para a obra de pavimentação de ruas deste CR;
Foi apresentada declaração do Diretor Geral do SAAE de que as ruas contempladas nesta proposta possuem rede de distribuição de água;
Foi apresentada declaração do prefeito municipal informando que existe solução de esgotamento sanitário - rede de esgotamento, nas Ruas Rio de Janeiro e Prodart, no entanto, encontra-se sem operação. Dessa forma, a solução de esgotamento sanitário será através de fossa e/ou sumidouro.
Foi apresentada Dispensa de Licenciamento Ambiental, emitida pela Secretaria Municipal de Meio Ambiente para as ruas da área de intervenção.',518,1,0,NULL,NULL)
