,(103,'“Os responsáveis técnicos pela execução dos serviços demandados são sempre os profissionais executores das atividades e formalmente vinculados às empresas credenciadas, conforme Lei nº. 5.194, de 24.12.1966, complementada pela Resolução nº. 425, de 18.12.98, do CONFEA e demais atos que regulamentam o exercício profissional do engenheiro, ou de acordo com a Lei n°. 12.378 de 31.12.2010, que regulamenta o exercício profissional de arquiteto. O monitoramento realizado por empregado do quadro próprio da CAIXA não implica em corresponsabilidade técnica pela atividade executada por empresa credenciada. A responsabilidade do monitor da atividade executada por empresa credenciada (engenheiro e/ou arquiteto do quadro de empregados da CAIXA) é limitada à verificação do preenchimento completo da peça técnica resultado da atividade demandada, bem como da coerência das informações ali registradas.” LAE elaborado pela empresa Pedro Augusto Chaves Filho Eireli ME. RT CREA 15.939/D GO (Pedro Augusto Chaves Filho).',563,0,0,NULL,NULL)
